from __future__ import print_function
import unittest
from  ImplementstrStr import Solution

class Test_TestImplementstrStr(unittest.TestCase):
    def test_strStr(self):
        self.assertEqual(Solution().strStr('','cdeg'),-1)
        self.assertEqual(Solution().strStr('',''),0)
        self.assertEqual(Solution().strStr('ac','ab'),-1)
        self.assertEqual(Solution().strStr('abdddcccdefg','c'),5)
        self.assertEqual(Solution().strStr('abcdefg','cde'),2)
        self.assertEqual(Solution().strStr('abcdefg','cdeg'),-1)
        self.assertEqual(Solution().strStr('abc','abc'),0)
        self.assertEqual(Solution().strStr('abcdefg',''),0)
        self.assertEqual(Solution().strStr('abcd','cde'),-1)
        self.assertEqual(Solution().strStr('aaa','aaaa'),-1)
        self.assertEqual(Solution().strStr("mississippi","issip"),4)
        print(Solution().strStr("",""))

if __name__ == '__main__':
    unittest.main()
